// https://leetcode.com/explore/learn/card/hash-table/184/comparison-with-other-data-structures/1177/
class MinimumIndexSum {

  fun execute(list0: Array<String>, list1: Array<String>): Array<String> {
    val sumIndexes = list0.mapIndexed { index, value -> index to value }.filter { list1.contains(it.second) }
        .map { (index, value) -> value to (index + list1.indexOf(value)) }
    val (_, min) = sumIndexes.minBy { it.second }!!
    return sumIndexes.filter { it.second == min }.map { it.first }.toTypedArray()
  }

  fun executeCleanerSolution(list0: Array<String>, list1: Array<String>): Array<String> {
    val map = list0.mapIndexed { index, value -> value to index }.toMap()
    val res: MutableList<String> = ArrayList()
    var minSum = Int.MAX_VALUE
    var sum: Int
    var j = 0
    while (j < list1.size && j <= minSum) {
      if (map.containsKey(list1[j])) {
        sum = j + map.getValue(list1[j])
        if (sum < minSum) {
          res.clear()
          res.add(list1[j])
          minSum = sum
        } else if (sum == minSum) res.add(list1[j])
      }
      j++
    }
    return res.toTypedArray()
  }
}


